(11, 106, 'Applicazione android', 'Vogliamo realizzare una versione android del portale \"Society Of Funding\" cos da poter raggiungere ancora pi persone!', 'Tecnology', 'Italia', '2018-09-09', '2019-09-09', 'IT66C010050', 50000, 55, 0),
(12, 108, 'Recuperiamo la mia Tesla', 'Voglio recuperare la mia Tesla!!! Ho dimenticato il mio cellulare nel vano porta oggetti!', 'Tecnology', 'Spazio', '2018-09-09', '2019-09-10', 'IT66C010050', 400000, 8000, 0),
(13, 106, 'Ristorante abruzzese', 'E\' da tempo che desidero aprire un ristorante di arrosticini abruzzesi per divulgare il credo in giro per il mondo! Ringrazio in anticipo tutti coloro che vorranno aiutarmi! \r\n\r\nP.S. Ricordate il motto: HARD LU FOCK... PI LI RRUSTELL! AMEN!', 'Food', 'Italia', '2018-09-09', '2019-05-28', 'IT66C010050', 200000, 6000, 0),
(14, 109, 'Corso di tuttologia', 'Il popolo , da sempre, sovrano. Vogliamo aiutare tutti gli studenti presso l\'Universit della Vita (Univi) e l\'Universit della Strada (Unistra), con l\'introduzione di un nuovo corso di tuttologia. Il conseguimento di tale titolo permetter a tutti di poter dare la propria opinione su qualsiasi argomento.', 'Charities', 'L\'Aquila', '2018-09-09', '2020-12-21', 'IT75H052170', 50000, 0, 0),
(15, 109, 'In vacanza con la Berte\'', 'Vorrei andare in Cina in autostop con Loredana Bert e Boomdabash. Tanto, questa sera, non potrete dirmi no. Se non dovessi raggiungere l\'obiettivo, arriviamo fino in Messico', 'Charities', 'Cina ', '2018-09-09', '2019-06-09', 'IT75H052160', 50000, 0, 0);
